def run(value_list):
    """
    Calculates the increase/decrease in Cash dividends within Appropriation of earnings from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    year_2018_cash_dividends = None
    year_2019_cash_dividends = None

    for item in value_list:
        if item['category'] == 'Cash dividends' and item['header1'] == '2018':
            year_2018_cash_dividends = item['number_value']
        elif item['header1'] == '2019':
            year_2019_cash_dividends = item['number_value']

    if year_2019_cash_dividends is not None and year_2018_cash_dividends is not None:
        increase_decrease = year_2019_cash_dividends - year_2018_cash_dividends
        return (round(increase_decrease, 2), '')
    else:
        return (0.00, '')

def run(value_list):
    """
    Calculates the increase/decrease in total fees from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    try:
        fees_2018 = float(value_list[0]['number_value'])
        fees_2019 = float(value_list[1]['number_value'])

        increase_decrease = fees_2019 - fees_2018

        if increase_decrease > 0:
            return (round(increase_decrease, 2), 'thousand')
        elif increase_decrease < 0:
            return (round(increase_decrease, 2), 'thousand')
        else:
            return (0.0, 'thousand')
    except (KeyError, TypeError, IndexError):
        return (0.0, 'thousand')

