def run(value_list):
    """
    Calculates the change in total emissions based on the provided value list.

    Args:
        value_list: A list of dictionaries containing emission data.

    Returns:
        A tuple (number, scale) representing the change in total emissions.
    """
    total_2019 = 0
    total_2018 = 0
    for item in value_list:
        if item['header3'] == '2019':
            total_2019 += item['number_value']
        elif item['header3'] == '2018':
            total_2018 += item['number_value']

    change = total_2019 - total_2018

    if change == 0:
        return (0.00, '')
    elif change > 0:
        return (round(change, 2), 'thousand')
    else:
        return (round(change, 2), 'thousand')

