def run(value_list):
    """
    Calculates the change in the basic net income per share between 2017 and 2018.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    try:
        # Extract data for 2017
        year_2017_value = next(
            (
                item
                for item in value_list
                if item["header2"] == "April 28, 2017"
            ),
            None,
        )
        if year_2017_value is None:
            return (0.00, "")

        # Extract data for 2018
        year_2018_value = next(
            (
                item
                for item in value_list
                if item["header2"] == "April 27, 2018"
            ),
            None,
        )
        if year_2018_value is None:
            return (0.00, "")

        # Calculate the change
        change = year_2018_value["number_value"] - year_2017_value["number_value"]

        return (round(change, 2), "")

    except StopIteration:
        return (0.00, "")

def run(value_list):
    """
    Calculates the percentage change in the weighted average hedged rate for the year from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    # Find the relevant values for 2018 and 2019
    rate_2018 = None
    rate_2019 = None

    for item in value_list:
        if item['header3'] == '2018' and item['category'] == 'Weighted average hedged rate for the year':
            rate_2018 = item['number_value']
        elif item['header3'] == '2019' and item['category'] == 'Weighted average hedged rate for the year':
            rate_2019 = item['number_value']

    if rate_2018 is not None and rate_2019 is not None:
        # Calculate the percentage change
        percentage_change = ((rate_2019 - rate_2018) / rate_2018) * 100
        return (round(percentage_change, 2), 'percent')
    else:
        return (0.00, '')

